'''dúath''', sometimes written '''dúwath''', is a [[Sindarin]] word meaning ''darkness'', ''shadow'', or ''nightshade''.  It is either the collective plural of ''[[dû]]'' or a compound of ''dû'' and ''[[gwath]]'' (hence ''dúwath'').

